CREATE TABLE IF NOT EXISTS `player_gasstation` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `citizenid` varchar(255) NOT NULL DEFAULT 'none',
  `username` varchar(255) NOT NULL DEFAULT 'none',
  `company_name` varchar(255) NOT NULL DEFAULT 'Gas Station',
  `company_money` int(15) NOT NULL DEFAULT 0,
  `blip_sprite` int(15) NOT NULL DEFAULT 415,
  `blip_color` int(15) NOT NULL DEFAULT 0,
  `current_capacity` int(15) NOT NULL DEFAULT 0,
  `max_capacity` int(15) NOT NULL DEFAULT 10000,
  `fuel_price` int(15) NOT NULL DEFAULT 2,
  `buy_price` int(11) DEFAULT 100000,
  `locations` longtext DEFAULT NULL,
  `items` longtext DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci ROW_FORMAT=DYNAMIC;

	